import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import ResultsCard from "./components/ResultCard"; 
import QuestionCard from "./components/QuestionCard";
import Login from "./components/Login";       
import Signup from "./components/Signup";  

import "./App.css";

export default function App() {
  return (
    <Router>
      <div className="App">
        <h1 className="title">Aptitude Challenge</h1>
        <Routes>
          <Route path="/" element={<QuizApp />} />            {/* Home / QuizApp */}
          <Route path="/login" element={<Login />} />        {/* Login page */}
          <Route path="/signup" element={<Signup />} />      {/* Signup page */}
          <Route path="/results" element={<ResultCard />} />{/* Results page */}
          <Route path="/question" element={<QuestionCard />} />{/* Question page */}
        </Routes>
      </div>
    </Router>
  );
}
